import Foundation

class Day4Hard {
    func solve() {
        let grid: [[Character]] = input.split(separator: "\n").map { Array($0) }
        var result = 0
        
        result += getNumberOfMatches(grid)
        let grid1 = rotate90Clockwise(grid)
        result += getNumberOfMatches(grid1)
        let grid2 = rotate90Clockwise(grid1)
        result += getNumberOfMatches(grid2)
        let grid3 = rotate90Clockwise(grid2)
        result += getNumberOfMatches(grid3)
        
        print(result)
    }
    
    func getNumberOfMatches(_ grid: [[Character]]) -> Int {
        var result = 0
        
        for x in 0..<grid.count-2 {
            for y in 0..<grid[x].count-2 {
                if grid[x][y] == "M" && grid[x+2][y] == "S" && grid[x+1][y+1] == "A" && grid[x][y+2] == "M" && grid[x+2][y+2] == "S" {
                    result += 1
                }
            }
        }
        
        return result
    }
    
    func rotate90Clockwise(_ grid: [[Character]]) -> [[Character]] {
        let rowCount = grid.count
        let colCount = grid[0].count
        var rotated = Array(repeating: Array(repeating: Character(" "), count: rowCount), count: colCount)
        
        for row in 0..<rowCount {
            for col in 0..<colCount {
                rotated[col][rowCount - row - 1] = grid[row][col]
            }
        }
        return rotated
    }
    
